            </div>

            <div>
                {/* Features Header */}
                <h2 style={{textAlign: "left"}}>Features</h2>
                    <Info_Card_Left header="Flight Management" description="Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Sollicitudin tempor id eu nisl nunc mi ipsum. Sit amet volutpat consequat mauris nunc congue. Auctor eu augue ut lectus arcu bibendum at varius. Sit amet est placerat in egestas erat imperdiet." handleClick={handleClick} image={placeholder}/>
